var LakeInfo=function(e,t){var o=this;this.name=ko.observable(e),this.href=ko.observable(t),this.county=ko.observable(),this.latlon=ko.observable(),this.area=ko.observable(),this.species=ko.observableArray(),this.selected=ko.observable(!1),this.marker=ko.observable(),this.lat=ko.computed(function(){if("undefined"==typeof o.latlon())return 0;if(0===o.latlon().length)return 0;var e=o.latlon().split(",");return e[0]}),this.lon=ko.computed(function(){if("undefined"==typeof o.latlon())return 0;if(0===o.latlon().length)return 0;var e=o.latlon().split(",");return e[1]}),this.speciesCount=ko.computed(function(){return o.species().length}),this.displayName=ko.computed(function(){return o.name()+"("+o.speciesCount()+")"}),this.place=ko.computed(function(){return o.name()+", "+o.county()+" county"}),this.iFishLink=ko.computed(function(){return"<a href='http://www.ifishillinois.org"+o.href()+"'>lake report at ifishillinois.org</a>"})};